import React, { Component } from "react";
import { Link, Route } from "react-router-dom";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { logoutUser } from "../../actions/authActions";


class Dashboard extends Component {
  onLogoutClick = e => {
    e.preventDefault();
    this.props.logoutUser();
  };
  render() {
      const { user } = this.props.auth;
      console.log("Auth here" + JSON.stringify(user));
  return (

    <div>



      <div style={{ height: "35vh" }} className="container valign-wrapper">

        <div className="row">
          <div className="col s12 center-align">
            <h4>
              <b>Hey there,</b> {user.name.split(" ")[0]}
              <p className="flow-text grey-text text-darken-1">
                You are logged into a full-stack{" "}
                <span style={{ fontFamily: "monospace" }}>Bug Tracker</span> app üëè
              </p>
            </h4>
            <button
              style={{
                width: "150px",
                borderRadius: "3px",
                letterSpacing: "1.5px",
                marginTop: "1rem"
              }}
              onClick={this.onLogoutClick}
              className="btn btn-large waves-effect waves-light hoverable blue accent-3"
            >
              Logout
            </button>
          </div>
              <button
                style={{
                width: "150px",
                borderRadius: "3px",
                letterSpacing: "1.5px",
                marginTop: "1rem"
              }}
                // onClick={
                //   <Redirect to={<>} />
                // }
                className="btn btn-large waves-effect waves-dark hoverable purple accent-3"

              >Projects</button>
        </div>
        <Route path="/buglist" exact component={BugList}/>
                <Route path="/edit/:id" component={EditBug} />
                <Route path="/create/" component={CreateBug} />
                <Route path="/projects" component={Projects}/>
                <Route path="/editProj/:id" component={EditProject} />
                <Route path="/createProj" component={CreateProject} />
                <Route path="/usersList" component={UsersList} />
                <Route path="/api/users/:id" component={EditUsers} />
                <Route path="/bugs/:id" component={ViewProjectBugs} />

      </div>
      </div>
    );
  }
}
Dashboard.propTypes = {
  logoutUser: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired
};
const mapStateToProps = state => ({
  auth: state.auth
});
export default connect(
  mapStateToProps,
  { logoutUser }
)(Dashboard);
